0443\u0440\u0434\u0435\u043d\u043a\u043e<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1708_%D0%B3%D0%BE%D0%B4\" title=\"1708 \u0433\u043e\u0434\">1708<\/a>&#160;\u2014 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u0433\u0435\u0442\u043c\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B7%D0%B5%D0%BF%D0%B0,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u0437\u0435\u043f\u0430, \u0418\u0432\u0430\u043d \u0421\u0442\u0435\u043f\u0430\u043d\u043e\u0432\u0438\u0447\">\u0418\u0432\u0430\u043d \u041c\u0430\u0437\u0435\u043f\u0430<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u0440\u0430\u0441\u0442\u043e\u0440\u0436\u0435\u043d\u0438\u0438 \u0441\u043e\u044e\u0437\u0430 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u043e\u043c I<\/a> \u0438 \u0434\u0432\u0438\u043d\u0443\u043b\u0441\u044f \u043d\u0430 \u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \u0441 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0448\u0432\u0435\u0434\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_XII_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u041a\u0430\u0440\u043b XII (\u043a\u043e\u0440\u043e\u043b\u044c \u0428\u0432\u0435\u0446\u0438\u0438)\">\u041a\u0430\u0440\u043b\u0430 XII<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794_%D0%B3%D0%BE%D0%B4\" title=\"1794 \u0433\u043e\u0434\">1794<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B2%D0%BE%D1%80%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0443\u0432\u043e\u0440\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0443\u0432\u043e\u0440\u043e\u0432<\/a> \u0437\u0430\u043d\u0438\u043c\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B3%D0%B0_(%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B0)\" title=\"\u041f\u0440\u0430\u0433\u0430 (\u0412\u0430\u0440\u0448\u0430\u0432\u0430)\">\u041f\u0440\u0430\u0433\u0443<\/a> (\u043f\u0440\u0435\u0434\u043c\u0435\u0441\u0442\u044c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B0\" title=\"\u0412\u0430\u0440\u0448\u0430\u0432\u0430\">\u0412\u0430\u0440\u0448\u0430\u0432\u044b<\/a>). \u041a\u043e\u043d\u0435\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D0%9A%D0%BE%D1%81%D1%82%D1%8E%D1%88%D0%BA%D0%BE\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u041a\u043e\u0441\u0442\u044e\u0448\u043a\u043e\">\u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044f<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815_%D0%B3%D0%BE%D0%B4\" title=\"1815 \u0433\u043e\u0434\">1815<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0431\u0435\u0434\u0430 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_I\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I<\/a> \u0438 \u043f\u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC_III\" title=\"\u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c III\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c III<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u044e\u0442 \u043e \u043f\u043e\u043c\u043e\u043b\u0432\u043a\u0435 \u0446\u0430\u0440\u0435\u0432\u0438\u0447\u0430 \u041d\u0438\u043a\u043e\u043b\u0430\u044f (\u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_I\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 I\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f I<\/a>) \u0438 \u043f\u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u043f\u0440\u0438\u043d\u0446\u0435\u0441\u0441\u044b \u0428\u0430\u0440\u043b\u043e\u0442\u0442\u044b (\u043f\u043e\u0441\u043b\u0435 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u044f \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0439 \u0432\u0435\u0440\u044b \u0441\u0442\u0430\u0432\u0448\u0435\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0439).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1848_%D0%B3%D0%BE%D0%B4\" title=\"1848 \u0433\u043e\u0434\">1848<\/a>&#160;\u2014 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 \u0423\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0412\u0442\u043e\u0440\u043e\u0439 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u0441\u0442\u0430\u0432\u0438\u0442\u0441\u044f \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1862_%D0%B3%D0%BE%D0%B4\" title=\"1862 \u0433\u043e\u0434\">1862<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D1%82%D0%BB%D0%B8%D0%BD%D0%B3,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B0%D0%BD\" title=\"\u0413\u0430\u0442\u043b\u0438\u043d\u0433, \u0420\u0438\u0447\u0430\u0440\u0434 \u0414\u0436\u043e\u0440\u0434\u0430\u043d\">\u0420\u0438\u0447\u0430\u0440\u0434 \u0413\u0430\u0442\u043b\u0438\u043d\u0433<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043c\u043d\u043e\u0433\u043e\u0441\u0442\u0432\u043e\u043b\u044c\u043d\u044b\u0439 \u043f\u0443\u043b\u0435\u043c\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D1%82%D0%B5%D1%87%D0%BD%D0%B8%D1%86%D0%B0_%D0%93%D0%B0%D1%82%D0%BB%D0%B8%D0%BD%D0%B3%D0%B0\" class=\"mw-redirect\" title=\"\u041a\u0430\u0440\u0442\u0435\u0447\u043d\u0438\u0446\u0430 \u0413\u0430\u0442\u043b\u0438\u043d\u0433\u0430\">Revolving Battery Gun<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1879_%D0%B3%D0%BE%D0%B4\" title=\"1879 \u0433\u043e\u0434\">1879<\/a>&#160;\u2014 \u0414\u0436\u0435\u0439\u0434\u0441 \u0420\u0438\u0442\u0442\u0438 \u043f\u0430\u0442\u0435\u043d\u0442\u0443\u0435\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D1%8B%D0%B9_%D0%B0%D0%BF%D0%BF%D0%B0%D1%80%D0%B0%D1%82\" class=\"mw-redirect\" title=\"\u041a\u0430\u0441\u0441\u043e\u0432\u044b\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442\">\u043a\u0430\u0441\u0441\u043e\u0432\u044b\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1890_%D0%B3%D0%BE%D0%B4\" title=\"1890 \u0433\u043e\u0434\">1890<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u043c\u0438\u0440\u0435 \u043f\u043e\u0434\u0437\u0435\u043c\u043d\u0430\u044f \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u043c\u0435\u0442\u0440\u043e<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u0432 \u0411\u0435\u0440\u043b\u0438\u043d\u0435 \u043c\u0435\u0436\u0434\u0443 \u0424\u0440\u0430\u043d\u0446\u0438\u0435\u0439 \u0438 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0435\u0439 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BE-%D0%B3%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D0%BE%D0%B3%D0%BB%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BE_%D0%9C%D0%B0%D1%80%D0%BE%D0%BA%D0%BA%D0%BE_%D0%B8_%D0%9A%D0%BE%D0%BD%D0%B3%D0%BE\" title=\"\u0424\u0440\u0430\u043d\u043a\u043e-\u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e \u041c\u0430\u0440\u043e\u043a\u043a\u043e \u0438 \u041a\u043e\u043d\u0433\u043e\">\u0444\u0440\u0430\u043d\u043a\u043e-\u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e \u041c\u0430\u0440\u043e\u043a\u043a\u043e \u0438 \u041a\u043e\u043d\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u043d\u0430 \u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u043e\u043c \u043a\u0440\u0435\u0439\u0441\u0435\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/SMS_Karlsruhe_(1912)\" title=\"SMS Karlsruhe (1912)\">\u00ab\u041a\u0430\u0440\u043b\u0441\u0440\u0443\u044d\u00bb (\u00abKarlsruhe\u00bb)<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0451\u043b \u0432\u0437\u0440\u044b\u0432 \u043f\u043e\u0433\u0440\u0435\u0431\u043e\u0432 \u0431\u043e\u0435\u043f\u0440\u0438\u043f\u0430\u0441\u0430. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 263 \u0447\u043b\u0435\u043d\u0430 \u044d\u043a\u0438\u043f\u0430\u0436\u0430, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043a\u043e\u043c\u0430\u043d\u0434\u0438\u0440 \u043a\u043e\u0440\u0430\u0431\u043b\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0412\u0420\u041a \u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0432\u0435\u0442\u0430 \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0