ipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>). \u0412\u0441\u0435 10 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a><ul><li>\u041d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044b\u0435 \u043d\u0435\u043c\u0446\u0430\u043c\u0438 \u043d\u0430 \u043e\u043a\u043a\u0443\u043f\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0439 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u0438<\/a> \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0430 \u0441\u0430\u043c\u043e\u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u0440\u0438\u0441\u0442\u0443\u043f\u0430\u044e\u0442 \u043a \u043e\u0431\u0441\u0443\u0436\u0434\u0435\u043d\u0438\u044e \u0432\u043e\u043f\u0440\u043e\u0441\u0430 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D1%8B%D1%88%D1%81%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD_%D0%A1%D0%A1\" class=\"mw-redirect\" title=\"\u041b\u0430\u0442\u044b\u0448\u0441\u043a\u0438\u0439 \u043b\u0435\u0433\u0438\u043e\u043d \u0421\u0421\">\u043b\u0430\u0442\u044b\u0448\u0441\u043a\u043e\u0433\u043e \u043b\u0435\u0433\u0438\u043e\u043d\u0430<\/a>.<\/li><li>\u041e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BD%D0%B6%D0%B5%D0%BD%D0%B5%D1%80%D0%BD%D0%BE-%D1%84%D0%B8%D0%B7%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82\" cla