0412\u0435\u043d\u0433\u0440\u0438\u044e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0432\u043e\u0438\u043d\u0441\u043a\u0438\u0445 \u0447\u0430\u0441\u0442\u0435\u0439 \u0438 \u0448\u0442\u0443\u0440\u043c \u0411\u0443\u0434\u0430\u043f\u0435\u0448\u0442\u0430) \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u043c\u0430\u0440\u0448\u0430\u043b\u0430 \u0413.&#160;\u041a.&#160;\u0416\u0443\u043a\u043e\u0432\u0430. \u041e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e&#160;\u2014 \u043f\u043e \u043f\u0440\u0438\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430, \u0441\u043f\u0435\u0448\u043d\u043e \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u043e\u0433\u043e \u042f\u043d\u043e\u0448\u0435\u043c \u041a\u0430\u0434\u0430\u0440\u043e\u043c.<\/li><li>\u041f\u0440\u043e\u0432\u043e\u0434\u044f\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u044f \u0442\u0443\u0440\u0431\u043e\u0440\u0435\u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83-104\" title=\"\u0422\u0443-104\">\u0422\u0443-104<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957_%D0%B3%D0%BE%D0%B4\" title=\"1957 \u0433\u043e\u0434\">1957<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-14_%D0%B2%D0%BE_%D0%92%D0%BD%D1%83%D0%BA%D0%BE%D0%B2%D0%B5_(1957)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-14 \u0432\u043e \u0412\u043d\u0443\u043a\u043e\u0432\u0435 (1957)\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-14 \u0440\u0443\u043c\u044b\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430<\/a> \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u043e\u0439<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 4 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u0421\u0440\u0435\u0434\u0438 \u0432\u044b\u0436\u0438\u0432\u0448\u0438\u0445&#160;\u2014 \u0431\u0443\u0434\u0443\u0449\u0438\u0439 \u0440\u0443\u043c\u044b\u043d\u0441\u043a\u0438\u0439 \u0434\u0438\u043a\u0442\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D1%83%D1%88%D0%B5%D1%81%D0%BA%D1%83,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5\" title=\"\u0427\u0430\u0443\u0448\u0435\u0441\u043a\u0443, \u041d\u0438\u043a\u043e\u043b\u0430\u0435\">\u041d\u0438\u043a\u043e\u043b\u0430\u0435 \u0427\u0430\u0443\u0448\u0435\u0441\u043a\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0441\u0438\u043b\u044c\u043d\u043e\u0435 \u043d\u0430\u0432\u043e\u0434\u043d\u0435\u043d\u0438\u0435 \u0432 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u0438 \u0441\u0435\u0432\u0435\u0440\u043d\u044b\u0445 \u0440\u0430\u0439\u043e\u043d\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a>. \u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%80%D0%B5%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u043b\u043e\u0440\u0435\u043d\u0446\u0438\u044f\">\u0424\u043b\u043e\u0440\u0435\u043d\u0446\u0438\u0438<\/a> \u043f\u0440\u0438\u0432\u043e\u0434\u0438\u0442 \u043a \u0442\u043e\u043c\u0443, \u0447\u0442\u043e \u0426\u0435\u043d\u0442\u0440 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430 \u044d\u043f\u043e\u0445\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BF%D0%BE%D1%85%D0%B0_%D0%92%D0%BE%D0%B7%D1%80%D0%BE%D0%B6%D0%B4%D0%B5%D0%BD%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u042d\u043f\u043e\u0445\u0430 \u0412\u043e\u0437\u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f\">\u0420\u0435\u043d\u0435\u0441\u0441\u0430\u043d\u0441\u0430<\/a> \u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d\u043d\u044b\u043c \u0432\u043e\u0434\u043e\u0439 \u043d\u0430 2 \u043c\u0435\u0442\u0440\u0430 \u043e\u0442 \u043f\u043e\u043b\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a><ul><li>\u0424\u0435\u0440\u043d\u0445\u0435\u0440\u0441\u0442, \u0421\u0430\u0441\u0441\u0435\u043a\u0441, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044f<\/a>. \u0420\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441\u0430\u043c\u043e\u043b\u0451\u0442 Sud Aviation Caravelle 10R \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Iberia_Airlines\" class=\"mw-redirect\" title=\"Iberia Airlines\">Iberia Airlines<\/a>\u00bb. \u0412\u0441\u0435 37 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442. \u0421\u043b\u0438\u0448\u043a\u043e\u043c \u0441\u0438\u043b\u044c\u043d\u043e\u0435 \u0441\u043d\u0438\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0432\u044b\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u043d\u0430 \u043f\u043e\u0441\u0430\u0434\u043a\u0443.<\/li><li>\u0412\u0432\u0435\u0434\u0435\u043d\u0430 \u0432 \u044d\u043a\u0441\u043f\u043b\u0443\u0430\u0442\u0430\u0446\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D0%B0%D0%BD%D0%BA%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%82%D0%B5%D0